import React, { useState } from 'react';
import { predictPCOS, predictPCOSFromImage } from './api';
import InputForm from './components/InputForm';
import ImageUploadForm from './components/ImageUploadForm';
import ResultDisplay from './components/ResultDisplay';
import Navbar from './components/Navbar';
import Footer from './components/Footer';

const App = () => {
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [activeTab, setActiveTab] = useState('form');

  const handleFormSubmit = async (formData) => {
    setLoading(true);
    setError(null);
    setResult(null);
    
    try {
      const prediction = await predictPCOS(formData);
      setResult(prediction);
    } catch (err) {
      console.error('Error predicting PCOS:', err);
      setError(err.message || 'An error occurred while processing your request. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const handleImageSubmit = async (image) => {
    setLoading(true);
    setError(null);
    setResult(null);
    
    try {
      const prediction = await predictPCOSFromImage(image);
      setResult(prediction);
    } catch (err) {
      console.error('Error predicting PCOS from image:', err);
      setError(err.message || 'An error occurred while processing your image. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="min-h-screen bg-gray-50 flex flex-col">
      <Navbar />
      
      <main className="flex-grow container mx-auto px-4 py-8">
        <div className="max-w-4xl mx-auto">
          <h1 className="text-3xl font-bold text-center mb-2 text-purple-800">PCOS Detection System</h1>
          <p className="text-center mb-8 text-gray-600">
            A machine learning approach to early detection of Polycystic Ovary Syndrome
          </p>

          <div className="bg-white rounded-lg shadow-md p-6 mb-8">
            <div className="border-b border-gray-200 mb-6">
              <nav className="-mb-px flex">
                <button
                  onClick={() => setActiveTab('form')}
                  className={`py-2 px-4 text-center w-1/2 border-b-2 font-medium text-sm ${
                    activeTab === 'form'
                      ? 'border-purple-500 text-purple-600'
                      : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                  }`}
                >
                  Symptom Based Analysis
                </button>
                <button
                  onClick={() => setActiveTab('image')}
                  className={`py-2 px-4 text-center w-1/2 border-b-2 font-medium text-sm ${
                    activeTab === 'image'
                      ? 'border-purple-500 text-purple-600'
                      : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                  }`}
                >
                  Ultrasound Image Analysis
                </button>
              </nav>
            </div>

            {activeTab === 'form' ? (
              <InputForm onSubmit={handleFormSubmit} isLoading={loading} />
            ) : (
              <ImageUploadForm onSubmit={handleImageSubmit} isLoading={loading} />
            )}

            {loading && (
              <div className="mt-8 text-center">
                <div className="inline-block animate-spin rounded-full h-8 w-8 border-b-2 border-purple-700"></div>
                <p className="mt-2 text-gray-600">Processing your data...</p>
              </div>
            )}

            {error && (
              <div className="mt-8 bg-red-50 border border-red-200 text-red-700 px-4 py-3 rounded relative">
                <strong className="font-bold">Error: </strong>
                <span className="block sm:inline">{error}</span>
              </div>
            )}

            {result && <ResultDisplay result={result} />}
          </div>

          <div className="bg-white rounded-lg shadow-md p-6 mb-8">
            <h2 className="text-xl font-semibold mb-4 text-gray-800">About PCOS</h2>
            <p className="mb-3 text-gray-600">
              Polycystic ovary syndrome (PCOS) is a hormonal disorder common among women of reproductive age. 
              Women with PCOS may have infrequent or prolonged menstrual periods or excess male hormone (androgen) levels.
            </p>
            <p className="mb-3 text-gray-600">
              The ovaries may develop numerous small collections of fluid (follicles) and fail to regularly release eggs.
              Early diagnosis and treatment of PCOS can reduce the risk of long-term complications.
            </p>
            <div className="mt-4">
              <h3 className="font-medium text-gray-700 mb-2">Common symptoms include:</h3>
              <ul className="list-disc pl-5 text-gray-600">
                <li>Irregular periods</li>
                <li>Excess androgen levels</li>
                <li>Polycystic ovaries</li>
                <li>Weight gain</li>
                <li>Acne</li>
                <li>Hair loss or excess hair growth</li>
              </ul>
            </div>
          </div>
        </div>
      </main>
      
      <Footer />
    </div>
  );
};

export default App;
